import React from "react";
import Card from "./Card";
import Button from "./Button";
import './Error.css';
const Error = (props) =>{
    return(
        <>
        <div className="backdrop" onClick={props.onHandlError}>
        <Card>
        <header className="header">
            <h2>{props.title}</h2>
        </header>

        <div className="content">
            <p>{props.message}</p>
        </div>

        <footer className="actions">
            <Button onClick = {props.onHandlError}>Okay</Button>
        </footer>

        </Card>
        </div>
        </>
    )
}

export default Error;
